package com.iu.s2.loops;

public class LoopFor3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//구구단을 입력하세요
		for (int i=1;i<10;i++) {
			for(int j=2;j<10;j++) {
				System.out.print(j+"*"+i+" = "+j*i);
				System.out.print("  ");
			}
			System.out.println(" ");
			
		}

	}

}
